import React, {useEffect, useState} from 'react'

//Bootstrap
import Container from "react-bootstrap/Container";

function Stats(props) {
    console.log(props);

    const confirmed = props.confirmed.map(confirmed =>
    <div>
        <h3>{confirmed.country}</h3>
        <p>{confirmed.latest}</p>
    </div>)

    return (
        <div className='stats'>
            <Container>
                {confirmed}
                <hr/>
            </Container>
        </div>
    )
}

export default  Stats
